import { v1 } from 'uuid';





export type FilterType = 'All' | 'Active' | 'Completed'


export type ButtonType = {
    name: string,
    callBack:()=>void
}


export function Button({name}:ButtonType) {

    const onClickHandler=()=>{
        callBack()
    }

    return (
        <button className="App" onClick={()=>onClickHandler()}>
         {name}
        </button>
    );
}
